column8:
アップリケとししゅうで作るインテリア壁飾り<br>
おしゃれフープ付き♪
<br><br>
◆難易度：初級～中級<br>
◆サイズ（約）：額内径：約13cm×13cm<br>
◆キット内容：布（9種）、ししゅう糸（2種）、おしゃれフープ(P-109木目)、作り方説明書、実物大型紙<br>　
◆用意するもの：縫い針・まち針・ししゅう針・縫い糸（布の色に近いもの）・ハサミ（布用・糸用・紙用）・定規・布に型紙を写す用具（布専用ペンなど）セロハンテープ・アイロン
<br><br>
・写真は作品例です。
<br><br>　
※写真と実際の商品の色とは多少異なる場合があります。　　<p>※メーカー希望小売価格はメーカーサイトに基づいて掲載しています。<br><img src="http://image.rakuten.co.jp/yuzawaya-2/cabinet/evidence/375-24-102_evide.jpg" border="0"></p><style type="text/css">
